/*Table structure for table `az_country` */

DROP TABLE IF EXISTS `az_country`;

CREATE TABLE `az_country` (
  `id_az_country` bigint(255) NOT NULL AUTO_INCREMENT,
  `m_by_created` bigint(255) DEFAULT NULL COMMENT 'Creado Por',
  `m_by_modified` bigint(255) DEFAULT NULL COMMENT 'Modificado Por',
  `m_date_created` datetime NOT NULL COMMENT 'Fecha Creado',
  `m_date_modified` datetime NOT NULL COMMENT 'Fecha Modificado',
  `m_deleted` tinyint(1) NOT NULL COMMENT 'Eliminado',
  `m_description` longtext COLLATE utf8_unicode_ci COMMENT 'Descripcion',
  `m_level` tinyint(1) NOT NULL COMMENT 'Nivel',
  `m_status` tinyint(1) NOT NULL COMMENT 'Estado',
  `m_temp` tinyint(1) NOT NULL COMMENT 'Temporal',
  `t_name` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Nombre',
  PRIMARY KEY (`id_az_country`),
  KEY `IDX_id_az_country` (`id_az_country`),
  KEY `IDX_m_by_created` (`m_by_created`),
  KEY `IDX_m_by_modified` (`m_by_modified`),
  KEY `IDX_m_date_created` (`m_date_created`),
  KEY `IDX_m_date_modified` (`m_date_modified`),
  KEY `IDX_m_deleted` (`m_deleted`),
  KEY `IDX_m_level` (`m_level`),
  KEY `IDX_m_status` (`m_status`),
  KEY `IDX_m_temp` (`m_temp`),
  KEY `IDX_t_name` (`t_name`)
) ENGINE=InnoDB AUTO_INCREMENT=199 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

