/*Table structure for table `az_data_personal` */

DROP TABLE IF EXISTS `az_data_personal`;

CREATE TABLE `az_data_personal` (
  `id_az_data_personal` bigint(255) NOT NULL AUTO_INCREMENT,
  `m_by_created` bigint(255) DEFAULT NULL COMMENT 'Creado Por',
  `m_by_modified` bigint(255) DEFAULT NULL COMMENT 'Modificado Por',
  `m_date_created` datetime NOT NULL COMMENT 'Fecha Creado',
  `m_date_modified` datetime NOT NULL COMMENT 'Fecha Modificado',
  `m_deleted` tinyint(1) NOT NULL COMMENT 'Eliminado',
  `m_description` longtext COLLATE utf8_unicode_ci COMMENT 'Descripcion',
  `m_level` tinyint(1) NOT NULL COMMENT 'Nivel',
  `m_status` tinyint(1) NOT NULL COMMENT 'Estado',
  `m_temp` tinyint(1) NOT NULL COMMENT 'Temporal',
  `t_address` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Direcccion',
  `t_birth_date` date DEFAULT NULL COMMENT 'Fecha Nacimiento',
  `t_names` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Nombres',
  `t_phone_fixed` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Telefono Fijo',
  `t_phone_movil` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Telefono Movil',
  `t_surnames` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Apellidos',
  `v_id_az_country` bigint(255) DEFAULT NULL COMMENT 'Id',
  `v_id_az_user` bigint(255) DEFAULT NULL COMMENT 'Id',
  PRIMARY KEY (`id_az_data_personal`),
  KEY `IDX_id_az_data_personal` (`id_az_data_personal`),
  KEY `IDX_m_by_created` (`m_by_created`),
  KEY `IDX_m_by_modified` (`m_by_modified`),
  KEY `IDX_m_date_created` (`m_date_created`),
  KEY `IDX_m_date_modified` (`m_date_modified`),
  KEY `IDX_m_deleted` (`m_deleted`),
  KEY `IDX_m_level` (`m_level`),
  KEY `IDX_m_status` (`m_status`),
  KEY `IDX_m_temp` (`m_temp`),
  KEY `IDX_t_address` (`t_address`),
  KEY `IDX_t_birth_date` (`t_birth_date`),
  KEY `IDX_t_names` (`t_names`),
  KEY `IDX_t_phone_fixed` (`t_phone_fixed`),
  KEY `IDX_t_phone_movil` (`t_phone_movil`),
  KEY `IDX_t_surnames` (`t_surnames`),
  KEY `IDX_v_id_az_country` (`v_id_az_country`),
  KEY `IDX_v_id_az_user` (`v_id_az_user`),
  CONSTRAINT `az_data_personal_ibfk_1` FOREIGN KEY (`v_id_az_country`) REFERENCES `az_country` (`id_az_country`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `az_data_personal_ibfk_2` FOREIGN KEY (`v_id_az_user`) REFERENCES `az_user` (`id_az_user`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=70 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

