/*Table structure for table `pd_data_business` */

DROP TABLE IF EXISTS `pd_data_business`;

CREATE TABLE `pd_data_business` (
  `id_pd_data_business` bigint(255) NOT NULL AUTO_INCREMENT,
  `m_by_created` bigint(255) DEFAULT NULL COMMENT 'Creado Por',
  `m_by_modified` bigint(255) DEFAULT NULL COMMENT 'Modificado Por',
  `m_date_created` datetime NOT NULL COMMENT 'Fecha Creado',
  `m_date_modified` datetime NOT NULL COMMENT 'Fecha Modificado',
  `m_deleted` tinyint(1) NOT NULL COMMENT 'Eliminado',
  `m_description` longtext COLLATE utf8_unicode_ci COMMENT 'Descripcion',
  `m_level` tinyint(1) NOT NULL COMMENT 'Nivel',
  `m_status` tinyint(1) NOT NULL COMMENT 'Estado',
  `m_temp` tinyint(1) NOT NULL COMMENT 'Temporal',
  `t_data_personal` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Direcccion',
  `t_date_admission` date DEFAULT NULL COMMENT 'Fecha Nacimiento',
  `t_date_contract_termination` date DEFAULT NULL COMMENT 'Correo Electronico',
  `t_value_bonus` decimal(26,0) DEFAULT NULL COMMENT 'Identificacion',
  `v_id_pd_campaign` bigint(255) DEFAULT NULL COMMENT 'Id',
  `v_id_pd_contract_type` bigint(255) DEFAULT NULL COMMENT 'Id',
  `v_id_pd_data_personal` bigint(255) DEFAULT NULL COMMENT 'Id',
  `v_id_pd_employee_charge` bigint(255) DEFAULT NULL COMMENT 'Id',
  PRIMARY KEY (`id_pd_data_business`),
  KEY `IDX_id_pd_data_business` (`id_pd_data_business`),
  KEY `IDX_m_by_created` (`m_by_created`),
  KEY `IDX_m_by_modified` (`m_by_modified`),
  KEY `IDX_m_date_created` (`m_date_created`),
  KEY `IDX_m_date_modified` (`m_date_modified`),
  KEY `IDX_m_deleted` (`m_deleted`),
  KEY `IDX_m_level` (`m_level`),
  KEY `IDX_m_status` (`m_status`),
  KEY `IDX_m_temp` (`m_temp`),
  KEY `IDX_t_data_personal` (`t_data_personal`),
  KEY `IDX_t_date_admission` (`t_date_admission`),
  KEY `IDX_t_date_contract_termination` (`t_date_contract_termination`),
  KEY `IDX_t_value_bonus` (`t_value_bonus`),
  KEY `IDX_v_id_pd_campaign` (`v_id_pd_campaign`),
  KEY `IDX_v_id_pd_contract_type` (`v_id_pd_contract_type`),
  KEY `IDX_v_id_pd_data_personal` (`v_id_pd_data_personal`),
  KEY `IDX_v_id_pd_employee_charge` (`v_id_pd_employee_charge`),
  CONSTRAINT `pd_data_business_ibfk_1` FOREIGN KEY (`v_id_pd_campaign`) REFERENCES `pd_campaign` (`id_pd_campaign`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `pd_data_business_ibfk_2` FOREIGN KEY (`v_id_pd_contract_type`) REFERENCES `pd_contract_type` (`id_pd_contract_type`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `pd_data_business_ibfk_3` FOREIGN KEY (`v_id_pd_data_personal`) REFERENCES `pd_data_personal` (`id_pd_data_personal`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `pd_data_business_ibfk_4` FOREIGN KEY (`v_id_pd_employee_charge`) REFERENCES `pd_employee_charge` (`id_pd_employee_charge`) ON DELETE SET NULL ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=105 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

